import React from 'react';

const Footer = () => {
    return (
        <div className="footer">
            <div className="footer-content">
                <p>&copy; 2024 Grade 9 - Jahanara Israil School & College</p>
                <div className="footer-links">
                    <a href="#" className="footer-link">Official Facebook Page</a>
                    <a href="jis.edu.bd" className="footer-link">Official Website</a>
                    <p className="footer-link">Official Number: +880 1234567890</p>
                </div>
            </div>
        </div>
    );
};

export default Footer;
